add_action('wp_ajax_infinity_news_fonts_ajax', 'infinity_news_fonts_ajax_cb');
add_action('wp_ajax_nopriv_infinity_news_fonts_ajax', 'infinity_news_fonts_ajax_cb');

// Recommendec Post Ajax Call Function.
function infinity_news_fonts_ajax_cb() {

    $family = $_POST['family'];
    $arr = infinity_news_font_array();
    $key = array_search($family, array_column($arr, 'family'));

    $variants = $arr[$key]['variants'];
    if( $variants ){
        $i = 1;
        foreach( $variants as $key => $value ){

            echo "<option value='".$key."'>".$value."</option>";
            $i++;
        }
    }
}


// Recommendec Post Ajax Call Function.
function infinity_news_fonts_variants( $font_family = '' ) {

    $arr = infinity_news_font_array();
    $key = array_search($font_family, array_column($arr, 'family'));
    $variants_lists = '';

    $variants = $arr[$key]['variants'];
    if( $variants ){
        foreach( $variants as $key => $value ){

            $variants_lists .= $key.',';
        }
    }

    return $variants_lists;

}

function infinity_news_google_fonts(){

    $google_fonts = infinity_news_font_array();
    foreach ($google_fonts as $key => $value) {
        $google_font[$value['family']] =  $value['family'] ;
    }
    return( $google_font );
}

